            <th scope="col">Both_dose</th>
            <th scope="col">Not_both_dose</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            <td><input type="checkbox" name="name1" /></td>
